                title={e.title}
                image={e.performers[0].image}
                venue={e.venue.name}
                type={e.type}
                address={e.venue.address}
                extended_address={e.venue.extended_address}
                date={e.datetime_local}

                url={e.url}

                >Hello</EventsResultsCard>     
            ))

        )
    }
}


export default EventsResults
